import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <>
      <footer className="footer-game">
        <p className="footer-link">
          Provided{" "}
          <span role="img" aria-label="heart-emoji">
            ❤️
          </span>{" "}
          by{" "}
          <a
            rel="noreferrer noopener"
          >
            CalmSpace
          </a>
        </p>
      </footer>
    </>
  );
}

export default Footer;
